import React from "react";
import ReactDom from "react-dom";
import "./header.css";

const Header = () => {
	return (
		<div class="header-container">
			<img src="https://i.imgur.com/Oo3eTto.jpg" alt="upcycle twine"/>
			<div class="header-content">
				<header-title>Insert Inspirational Quote</header-title>
			</div>
		</div>
	);
};

export default Header;
